import { Container, Row, Col, Nav, NavDropdown, ListGroup, Navbar, NavbarBrand } from "react-bootstrap";
// import { ReactComponent as Logo } from "../img/logo.svg";
import "../img/logo.svg";
import "../Styles.css";

function Header() {
  return (
    <Navbar bg="dark">
        <Container>
            <Nav>
                <NavbarBrand>
                    <img src="" alt="logo" />
                </NavbarBrand>
            </Nav>
            <Nav className="m-auto">
                <Nav.Link href="#index">About us</Nav.Link>
                <Nav.Link href="#index">Products</Nav.Link>
                <NavDropdown>
                    <Nav.Link href="#index">Products</Nav.Link>
                </NavDropdown>
                <Nav.Link href="#index">Resources</Nav.Link>
            </Nav>
            <Nav>
                <Nav.Link href="#index">Login</Nav.Link>
                <Nav.Link href="#index">Register</Nav.Link>
            </Nav>
        </Container>
    </Navbar>
  );
}

export default Header
